import {BrowserRouter, Route, Routes, Navigate} from 'react-router-dom'
import { useAuthContext } from './hooks/useAuthContext'

import Home from './pages/home/Home'
import Login from './pages/login/Login'
import Signup from './pages/signup/Signup'
import Navbar from './components/Navbar'

function App() {
  const { alreadyLogged, user }: any = useAuthContext()

  return (
    <div className="App">
      {alreadyLogged && (
      <BrowserRouter>
      <Navbar />
        <Routes>
          <Route path ="/"   element={!user && <Navigate to="/login"/> || user && <Home />}/>
          <Route path ="/login" element={!user && <Login /> || user && <Navigate to="/" />} />
          <Route path ="/signup" element={!user && <Signup /> || user && user.displayName && <Navigate to="/" />} />
        </Routes>
      </BrowserRouter>
      )}
    </div>
  );
}

export default App;
